[{"location":"devices/#Storage-Devices","page":"Storage Devices","title":"Storage Devices","text":"","category":"section"},{"location":"devices/","page":"Storage Devices","title":"Storage Devices","text":"BESS","category":"page"},{"location":"devices/#NEMStorageUnderUncertainty.BESS","page":"Storage Devices","title":"NEMStorageUnderUncertainty.BESS","text":"BESS(\n    power_capacity::Float64,\n    nominal_energy_capacity::Float64,\n    soc_min::Float64,\n    soc_max::Float64,\n    η_charge::Float64,\n    η_discharge::Float64,\n    soc₀::Float64\n)\n\nInitialises a battery energy storage system (BESS)\n\nArguments\n\npower_capacity: Maximum charge/discharge power capacity (MW)\nenergy_capacity: Maximum energy capacity (MWh)\nsoc_min: Minimum allowable operational state of charge (MWh)\nsoc_max: Maximum allowable operational state of charge (MWh)\nη_charge: Charging efficiency (0-1)\nη_discharge: Discharge efficiency (0-1)\nsoc₀: Initial state of charge (MWh)\nthroughput: Energy throughput (MWh)\n\nReturns\n\nA BESS with mutable energy_capacity, soc_min, soc_max and throughput.\n\n\n\n\n\n","category":"type"},{"location":"data/#Price-Data-Compilers","page":"Price Data Compilers","title":"Price Data Compilers","text":"","category":"section"},{"location":"data/","page":"Price Data Compilers","title":"Price Data Compilers","text":"Modules = [NEMStorageUnderUncertainty]\nPages = [\"data.jl\"]","category":"page"},{"location":"data/#NEMStorageUnderUncertainty.get_all_actual_prices-Tuple{String}","page":"Price Data Compilers","title":"NEMStorageUnderUncertainty.get_all_actual_prices","text":"get_all_actual_prices(path::String)\n\nObtains actual price data from parquet files located at path\n\nArguments\n\npath: Path to parquet partitions\n\nReturns\n\nDataFrame with settlement date, region and corresponding energy prices\n\n\n\n\n\n","category":"method"},{"location":"data/#NEMStorageUnderUncertainty.get_all_forecast_prices-Tuple{String, String}","page":"Price Data Compilers","title":"NEMStorageUnderUncertainty.get_all_forecast_prices","text":"get_all_forecast_prices(pd_path::String, p5_path::String)\n\nObtains and compiles all forecasted price data from parquet files located at the P5MIN path (p5_path) and the PREDISPATCH path (pd_path)\n\nNote that Parquet.jl cannot parse Timestamps from .parquet, so we use unix2datetime.\n\nArguments\n\npd_path: Path to PREDISPATCH parquet partitions\np5_path: Path to P5MIN parquet partitions\n\nReturns\n\nCompiled forecast data, with PREDISPATCH forecasts that overlap with P5MIN removed. Compiled forecast data has actual run times, forecasted times, regions and their corresponding energy prices.\n\n\n\n\n\n","category":"method"},{"location":"data/#NEMStorageUnderUncertainty.get_forecast_prices_by_times-Tuple{DataFrames.DataFrame}","page":"Price Data Compilers","title":"NEMStorageUnderUncertainty.get_forecast_prices_by_times","text":"get_forecast_prices_by_times(\nforecast_prices::DataFrame,\nforecasted_times::Tuple{DateTime, DateTime}=nothing,\nrun_times::Tuple{DateTime, DateTime}=nothing\n)\n\nFilters forecast prices based on supplied run_times (start, end) and forecasted_times (start, end)\n\nArguments\n\nforecast_prices: DataFrame produced by get_all_forecast_prices\nforecasted_times: (starttime, endtime), inclusive\nrun_times: (starttime, endtime), inclusive\n\nReturns\n\nFiltered forecast prices\n\n\n\n\n\n","category":"method"},{"location":"#Model-Documentation","page":"Home","title":"Model Documentation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"This is documentation for a modelling framework built to explore the impact of future market information (forecasts) on the operation of energy storage in the National Electricity Market (NEM).","category":"page"},{"location":"","page":"Home","title":"Home","text":"Pages = [\"devices.md\", \"data.md\"]\nDepth = 1","category":"page"}]
